      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n\"@context\":\"https:\/\/schema.org\/\",\n\"@type\":\"Course\",\n\"name\":\"Business Major Program\",\n\"description\": \"Business requires financial decisions in all areas and levels of business. Whether you are engaged with a for-profit or non-profit organization, the ability to effectively identify, quantify, and manage risk is essential to success and sustainability. Through the use of case studies, simulations, and financial modeling you will learn how to assess the financial implications of your decisions while critically solving problems.\",\n \"schema:provider\": {\n    \"@type\": \"schema:CollegeOrUniversity\",\n    \"schema:name\": \"Bethel University\",\n    \"schema:url\": \"https:\/\/www.bethel.edu\/\",\n       \"additionalType\": \n       [\"https:\/\/en.wikipedia.org\/wiki\/Bachelor_of_Business\", \t\t\t\t\t        \t\t\t\"https:\/\/en.wikipedia.org\/wiki\/Business_education\"],\n        \"mainEntityOfPage\":\"https:\/\/www.bethel.edu\/undergrad\/academics\/business-economics\/majors-minors\/business-major\/\",\n       \"potentialAction\":{\n          \"@type\":\"Action\",\n          \"name\":\"Apply Now\",\n          \"actionStatus\":\"PotentialActionStatus\",\n          \"description\":\"Admissions Application. Ready to apply? If you have any questions along the way, contact your admissions counselor. It's their job to help you outand it's what they love to do.\",\n          \"id\": \"https:\/\/www.bethel.edu\/undergrad\/admissions\/apply\/\",\n          \"target\":\"https:\/\/www.bethel.edu\/admissions\/apply\/\",\n       \"potentialAction\":{\n          \"@type\":\"InteractAction\",\n          \"name\":\"Contact Us\",\n          \"actionStatus\":\"PotentialActionStatus\",\n          \"id\": \"https:\/\/www.bethel.edu\/undergrad\/admissions\/contact\/\",\n          \"description\":\"Don't hesitate to contact us. We're here to help you find the information you need. You can always find your admissions counselor and send them questions directly. If you'd like us to mail you any additional information, fill out our request info form.\",\n          \"target\":\"https:\/\/www.bethel.edu\/undergrad\/admissions\/contact\/request-information\/\",\n       \"potentialAction\":{\n          \"@type\":\"Action\",\n          \"name\":\"Visit Campus\",\n          \"id\": \"https:\/\/www.bethel.edu\/undergrad\/admissions\/visit\/\",\n          \"actionStatus\":\"PotentialActionStatus\",\n          \"description\":\"You can read all the facts about who we are and what we offer, but the best way to get a feel for life at Bethel is to experience it for yourself. Select the visit option that best fits your needs.\",\n          \"target\":\n          [\"https:\/\/www.bethel.edu\/undergrad\/admissions\/visit\/individual-visits\",\n           \"https:\/\/www.bethel.edu\/undergrad\/admissions\/visit\/events\",\n           \"https:\/\/www.bethel.edu\/undergrad\/admissions\/visit\/groups\"]\n                }\n\t\t\t}\n\t\t}\n\t }\n }\n\u003C\/script\u003E",
