      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n\"@context\":\"https:\/\/schema.org\/\",\n\"@type\":\"Course\",\n\"name\":\"Athletic Training (M.S.) Program\",\n\"description\": \"Bethels Master of Science (M.S.) in Athletic Training is designed for people who want to impact lives through the exciting field of athletic training. Whether you're coming straight from a Bethel undergraduate program or have a degree from another university, you'll build practical, hands-on skills and have the opportunity to become a Certified Athletic Trainer. This program prepares students for careers in sports medicine, while infusing faith- and ethics-based principles and helping them build a clinical network for life.\",\n \"schema:provider\": {\n    \"@type\": \"schema:CollegeOrUniversity\",\n    \"schema:name\": \"Bethel University\",\n    \"schema:url\": \"https:\/\/www.bethel.edu\/\",\n       \"additionalType\": \n       [\"https:\/\/en.wikipedia.org\/wiki\/Athletic_training\", \t\t\t\t\t        \t\t\t\t\"https:\/\/en.wikipedia.org\/wiki\/National_Athletic_Trainers%27_Association\"],\n        \"mainEntityOfPage\":\"https:\/\/www.bethel.edu\/graduate\/academics\/athletic-training\/\",\n       \"potentialAction\":{\n          \"@type\":\"Action\",\n          \"name\":\"Apply Now\",\n          \"actionStatus\":\"PotentialActionStatus\",\n          \"description\":\"Admissions Application. First time here? Create an account.\",\n          \"target\":\"https:\/\/www.bethel.edu\/admissions\/apply\/\",\n       \"potentialAction\":{\n          \"@type\":\"Action\",\n          \"name\":\"Request Info\",\n          \"actionStatus\":\"PotentialActionStatus\",\n          \"description\":\"Please use the form below to request information from Bethel University's graduate school admissions office. Don't hesitate to contact admissions if you have any questions.\",\n          \"target\":\"https:\/\/www.bethel.edu\/graduate\/admissions\/contact\/request-information\/\",\n       \"potentialAction\":{\n          \"@type\":\"Action\",\n          \"name\":\"Visit Us\",\n          \"id\": \"https:\/\/www.bethel.edu\/graduate\/admissions\/events\/\",\n          \"actionStatus\":\"PotentialActionStatus\",\n          \"description\":\"Interested in learning more about our graduate programs? Attend an information session, view a webinar, or schedule a visit to learn more about Bethel and get your questions answered. At our information sessions, you'll be able to meet with an admissions advisor, learn more about any programs you're interested in, hear more about Bethel, and check out the campus environment. Please register to let us know you'll be joining us!\",\n          \"target\": \"https:\/\/www.bethel.edu\/graduate\/admissions\/events\/rsvp\"\n                }\n\t\t\t}\n\t\t}\n\t }\n }\n\u003C\/script\u003E",
